import React from 'react'
import Navs from './Navs'
import Title from './Title'

function MainPageLayout({children}) {
    return (
        <div>
            <Title title="BOX OFFICE" subtitle/>
            <Navs/>
            {children}
        </div>
    )
}

export default MainPageLayout
